.block-plans .grid {
  gap: 8rem 4rem;
}
.block-plans .card {
  max-width: 500px;
  margin: 0 auto;
}

.plan {
  transition: transform 0.3s ease-out;
}
/*features*/

.feature {
  gap: 4rem 2rem;
  margin: 12rem 0;
}
.feature:first-of-type {
  margin-top: 6rem;
}
.feature__heading {
  margin: 2rem 0;
}
.feature__description {
  margin-bottom: 2rem;
}
.feature__image {
  width: 100%;
}

@media screen and (min-width: 768px) {
  .feature:nth-of-type(even) .feature__content {
    order: 2;
  }
}
/*Block Showcase*/

.block-showcase__image {
  width: 100%;
}

@media screen and (min-width: 768px) {
  .block-showcase .grid {
    grid-template-columns: 50% 50%;
  }
  .block-showcase__image {
    width: auto;
  }
}
/*footer*/

.footer {
  background: #232323;
}
.footer__section {
  padding: 2rem;
  border-bottom: 1px solid #393939;
}

.footer__heading {
  text-transform: uppercase;
  font-weight: 600;
}
.footer a {
  color: #777;
  cursor: pointer;
}
.footer__brand {
  margin-top: 5rem;
  text-align: center;
}
.footer__copyright {
  font-size: 2.1rem;
  color: #fff;
  opacity: 0.3;
}
.footer li {
  margin: 1.5rem 0;
}

@media screen and (min-width: 768px) {
  .footer__sections {
    grid-template-columns: repeat(auto-fit, minmax(10rem, 1fr));
  }
  .footer .collapsible__chevron {
    display: none;
  }
  .footer .collapsible__content {
    opacity: 1;
    max-height: 100%;
  }
  .footer__brand {
    order: -1;
    margin-top: 1rem;
  }
  /*TODO: Consider refactoring this and applying it to all images. conseidering applying this to all images. */
  .footer__brand img {
    width: 100%;
    max-width: 230px;
  }
  .footer__copyright {
    font-size: 1.5rem;
  }
  .footer__section {
    border-bottom: 0;
  }
  .footer__heading {
    font-size: 1.6rem;
  }
  .collapsible__content {
    font-size: 1.5rem;
  }
  .footer li {
    padding: 0.5rem 0;
    margin: 0;
  }

  .footer a:hover {
    color: #fff;
    transition: color 0.3s;
  }
}

